from fractions import gcddef repunit(ranger):    string=""    for i in range(ranger):        string=string+"1"    string=int(string)    return int(string)testcases=int(input())list=[]for i in range(testcases):    list.append(input())for i in range(len(list)):    list[i]=int(list[i])flag=1#print(gcd(7,10))for i in range(testcases):    for k in range(1,int(list[i])):        if(gcd(int(list[i]),10)==1):            if(testcases>=1 and testcases<=20000):                if(list[i]>=1 and list[i]<=pow(10,6)):                    flag=0        if((repunit(k)%int(list[i]))==0 and flag==0):            print(k)